import TimeAgo from "javascript-time-ago";

export const DisplayDate = str => {
  const timeAgo = new TimeAgo();
  // console.log(new Date(Date.parse(str)));
  console.log(timeAgo.format(Date.now() - 60 * 1000));
};

export default DisplayDate;
